import { gql, useQuery } from "@apollo/client";

const GET_USERS = gql`
  query MyQuery(
    $order_by: [users_order_by!] = { name: desc }
    $_neq: String = ""
  ) {
    users(order_by: $order_by, where: { id: { _neq: $_neq } }) {
      id
      name
      picture
    }
  }
`;


export default Contact;
